B.Nn=new A.dp("Prestiio","Prestiio is designed to bring together females into the same space to create meaningful conversations and discussions, with the primary objective of uplifting, motivating and enabling a prosperous future for all. Prestiio app is designed for easy communication, whilst also protecting user privacy and data, we understand that safety is a crucial element when it comes to protecting users from the negative sides of the internet.\n\nThe features of the app are:\n\u2022 Social networking space for users to post statuses on the timeline, and users can either post as themselves or anonymously;\n\u2022 Find emergency services around you whether its hospitals, pharmacies, police stations etc.;\n\u2022 In-app messaging (which is free) with other users you connect with on the app;\n\u2022 Create polls for any topic of discussion;\n\u2022 Host live events and conference, with access to potential attendees either locally or from around the globe;\n\u2022 Create blogs or think pieces for engagement and knowledge sharing;\n\u2022 Celebrate with other users from either your country or around the world via our 'Moments';\n\u2022 An SOS emergency button within the app\n","https://firebasestorage.googleapis.com/v0/b/my-converter-flutter.appspot.com/o/app_logos%2Fpresttio.png?alt=media&token=a7d8eb22-407b-455b-8f01-2bbb7f0ceea2","","",B.HC,B.Hh,"https://apps.apple.com/pk/app/prestiio/id1557092619","https://play.google.com/store/apps/details?id=app.prestiio&pcampaignid",B.Hz)
